import React from "react";
import Image from "./image";
import { DefaultInput } from "../form/input-fields/primary-input";
import { Checkbox } from "../form/inputs";
import { ContentWrapper, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Title, SubTitle, InputContainer,CheckBoxContainer } from "./elements";
import styled from "styled-components";
import colors from ".././../theme/main/colors";

const LinkWithLine = styled("a")`
color:${colors.primary};
padding-left:5px;

}
`;

const TitleContainer = styled("div")`
margin-top:-20px;
margin-bottom:20px;

}
`;


const Signup = () => {

    return (
        <>
            <ContentWrapper>
                <Image />
                <FormContainer>
                    <CenteredForm>
                        <HeaderContainer>
                            <Title>Signup with Taxiye</Title>
                            <SubTitle>Tell us who you are. Please enter your correct detail below</SubTitle>
                        </HeaderContainer>
                        <ContentContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="First Name *"
                                    placeholder="John"
                                    id="firstname" />
                            </InputContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="Last Name *"
                                    placeholder="Doe"
                                    id="lastname" />
                            </InputContainer>
                            <InputContainer>
                                <DefaultInput
                                    label="Email Address *"
                                    placeholder="Johndoe@gmail.com"
                                    id="emailaddress" />
                            </InputContainer>
                            <TitleContainer>
                                <CheckBoxContainer>
                                    <Checkbox id="1" placeholder="I agree to Taxiye's" />
                                    <LinkWithLine href="/">Terms of service</LinkWithLine>
                                </CheckBoxContainer>

                            </TitleContainer>
                            <CustomButton>Create account</CustomButton>
                        </ContentContainer>
                    </CenteredForm>
                </FormContainer>


            </ContentWrapper>
        </>
    );
};

export default Signup;
